import React, { Component } from 'react'
import img1 from "./img1.jpg"
import img2 from "./img2.jpg"
import img3 from "./img3.jpg"
import img4 from "./img4.jpg"
import Carditems from "./CardItems"

class Users extends Component {
  render() {
    return (
      <div className='row'>
          <Carditems pr = {{
            profileImg:img1,
            title:"Front- Developer",
            name:"Yassin Ait Kaddour",
            email: "yait.kad@gmail.com",
            web: "www.yaskad.com"
          }}/>
          <Carditems pr = {{
            profileImg:img2,
            title:"Web Designer",
            name:"Youssef Belmokhtar",
            tel: "0623659966",
            email: "jhon@gmail.com",
            web: "www.jhon.com"
          }}/>
        {/* <div className='w-10'></div> */}
          <Carditems pr = {{
            profileImg:img3,
            title:"Full-Stack Developer",
            name:"Ishaan Khan",
            tel: "0699125485",
            email: "Ishaan@Khan.com",
            web: "www.khan.com"
          }}/>
          <Carditems pr = {{
            profileImg:img4,
            title:"Web Developper",
            name:"WalterWait",
            tel: "0699125485",
            email: "Wait@gmail.com",
          }}/>
      </div>

    )
  }
}




export default Users;
